import React from "react";

export const Button = ({ onClick, children, className }) => {
  return (
    <button
      onClick={onClick}
      className={`bg-blue-500 text-white py-2 px-4 rounded-md hover:bg-blue-700 ${className}`}
    >
      {children}
    </button>
  );
};
